import React from 'react';
import {   Marker,InfoWindow } from "react-google-maps";
import car2 from './car2.png';
import {loc} from './loc';


const Cardlist1=({handleToggleOpen,isOpen,indexOpen})=>{
  
    const CardCarLocation1= loc.map((user,i)=>{
        return   <Marker
                            key={i}
                            google={this.props.google}
                            name={'Dolores park'}
                            position={{ lat: loc[i].lat, lng: loc[i].lng }}
                            
                             icon={{

                                  url: car2,
                                  scaledSize :  window.google.maps.Size(25,25 ),

    }}

        
                            
                         onClick={() => handleToggleOpen(i)}

        
                            
                        >
                       {isOpen && i===indexOpen &&( 
                        <InfoWindow
                            
                        >
                         
                            <div>
                                <span style={{ padding: 0, margin: 0 }}>rajawi </span>
                            </div>
                        </InfoWindow>)}
                    </Marker>
    })


}



export default Cardlist1;
